  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113581 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the Davis Strait,
  Labrador Sea and North Atlantic Ocean from 1994-11-15 to 1994-12-19 and retrieved
  during cruise 06MT19941115 (06MT303). These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential
  temperature (theta), SALINITY, SILICATE, TRITIUM and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  H. Thomas of Commonwealth Scientific and Industrial Research Organization and J.
  Meincke [affiliation unknown] as part of the CARINA/06MT19941115, WOCE A01 data
  set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is
  an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
